import React from "react";
import styled from "styled-components";

const Container = styled.div`
    position: fixed;
    width: 3.5%;
    height: 100vh;

    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`;

const SidebarContainer = styled.div`
    position: relative;
    background-color: #D40F0F;
    width: 100%;
    height: 80%;
    color: #FFF;

    display: flex;
    flex-direction: column;
`;

const ListItem = styled.ul`
    list-style: none;
    padding: 0;
    flex: 2;
`

const Item = styled.li`
    font-size: 2rem;
    cursor: pointer;
    margin: 20px 0;
`

const ProfileContainer = styled.div`

`

const Profile = styled.img`
    width: 50px;
    height: 50px;
    object-fit: cover;
    flex: 1;
`

function Sidebar() {
    return (
        <Container>
            <SidebarContainer>
                <ListItem>
                    <Item>
                        <i className="fa-solid fa-house"></i>
                    </Item>
                    <Item>
                        <i className="fa-solid fa-address-card"></i>
                    </Item>
                    <Item>
                        <i className="fa-solid fa-arrows-turn-to-dots"></i>
                    </Item>
                    <Item>
                        <i className="fa-brands fa-autoprefixer"></i>
                    </Item>
                    <Item>
                        <i className="fa-solid fa-file-signature"></i>
                    </Item>
                </ListItem>
                <ProfileContainer>
                <Profile src="https://picsum.photos/300/300" alt="" />
                </ProfileContainer>
            </SidebarContainer>
        </Container>
    );
}

export default Sidebar;
